import { spawn } from "child_process";
var DEFAULT_TIMEOUT = 30000;
var MAX_OUTPUT_LENGTH = 50000;
var executeCommandTool = {
  name: "executeCommand",
  description: "Executes a shell command and returns the output",
  parameters: {
    type: "object",
    properties: {
      command: {
        type: "string",
        description: "The command to execute"
      },
      cwd: {
        type: "string",
        description: "The working directory for the command (defaults to current directory)"
      },
      timeout: {
        type: "number",
        description: "Timeout in milliseconds (defaults to 30000)"
      }
    },
    required: ["command"]
  },
  execute: async (params) => {
    const {
      command,
      cwd = process.cwd(),
      timeout = DEFAULT_TIMEOUT
    } = params;
    return executeCommand(command, cwd, timeout);
  }
};
function executeCommand(command, cwd = process.cwd(), timeout = DEFAULT_TIMEOUT) {
  return new Promise((resolve2) => {
    let stdout = "";
    let stderr = "";
    let killed = false;
    const child = spawn("sh", ["-c", command], {
      cwd,
      env: process.env,
      stdio: ["ignore", "pipe", "pipe"]
    });
    const timer = setTimeout(() => {
      killed = true;
      child.kill("SIGTERM");
      setTimeout(() => {
        if (!child.killed) {
          child.kill("SIGKILL");
        }
      }, 1000);
    }, timeout);
    child.stdout.on("data", (data) => {
      stdout += data.toString();
      if (stdout.length > MAX_OUTPUT_LENGTH) {
        stdout = stdout.slice(0, MAX_OUTPUT_LENGTH) + `
... (output truncated)`;
        child.kill("SIGTERM");
      }
    });
    child.stderr.on("data", (data) => {
      stderr += data.toString();
      if (stderr.length > MAX_OUTPUT_LENGTH) {
        stderr = stderr.slice(0, MAX_OUTPUT_LENGTH) + `
... (output truncated)`;
      }
    });
    child.on("error", (error) => {
      clearTimeout(timer);
      resolve2({
        success: false,
        error: `Failed to execute command: ${error.message}`
      });
    });
    child.on("close", (code) => {
      clearTimeout(timer);
      if (killed) {
        resolve2({
          success: false,
          error: `Command timed out after ${timeout}ms`,
          data: { stdout, stderr }
        });
        return;
      }
      if (code === 0) {
        resolve2({
          success: true,
          data: {
            exitCode: code,
            stdout: stdout.trim(),
            stderr: stderr.trim()
          }
        });
      } else {
        resolve2({
          success: false,
          error: `Command exited with code ${code}`,
          data: {
            exitCode: code,
            stdout: stdout.trim(),
            stderr: stderr.trim()
          }
        });
      }
    });
  });
}
var shellTools = [executeCommandTool];

