function buildSkillSystemPrompt(skill) {
  const lines = [
    `You are executing the "${skill.name}" skill.`,
    "",
    skill.description,
    ""
  ];
  if (skill.executionPattern.length > 0) {
    lines.push("## Execution Pattern");
    skill.executionPattern.forEach((step, i) => {
      lines.push(`${i + 1}. ${step}`);
    });
    lines.push("");
  }
  lines.push("## Guidelines");
  lines.push("- Use the available tools to accomplish the task");
  lines.push("- Be concise and focused on the specific task");
  lines.push("- Report any errors clearly");
  return lines.join(`
`);
}
function buildSkillUserPrompt(instructions, context) {
  const lines = ["## Instructions", instructions];
  if (Object.keys(context).length > 0) {
    lines.push("", "## Context");
    for (const [key, value] of Object.entries(context)) {
      lines.push(`${key}: ${JSON.stringify(value)}`);
    }
  }
  return lines.join(`
`);
}
function convertToolsToAISDK(tools) {
  const result = {};
  for (const t of tools) {
    const properties = {};
    for (const [key, prop] of Object.entries(t.parameters.properties)) {
      let schema;
      switch (prop.type) {
        case "string":
          schema = exports_external.string().describe(prop.description);
          break;
        case "number":
          schema = exports_external.number().describe(prop.description);
          break;
        case "boolean":
          schema = exports_external.boolean().describe(prop.description);
          break;
        default:
          schema = exports_external.any().describe(prop.description);
      }
      if (!t.parameters.required?.includes(key)) {
        schema = schema.optional();
      }
      properties[key] = schema;
    }
    result[t.name] = tool({
      description: t.description,
      parameters: exports_external.object(properties),
      execute: async (params) => {
        const toolResult = await t.execute(params);
        if (!toolResult.success) {
          throw new Error(toolResult.error || "Tool execution failed");
        }
        return toolResult.data;
      }
    });
  }
  return result;
}
async function executeSkill(ctx) {
  const { skill, instructions, context, conversationHistory } = ctx;
  try {
    if (skill.customTools) {
      registerTools(Object.values(skill.customTools));
    }
    const requestedTools = getTools(skill.tools);
    if (skill.customTools) {
      requestedTools.push(...Object.values(skill.customTools));
    }
    const model = getModel(skill.model);
    const systemPrompt = buildSkillSystemPrompt(skill);
    const userPrompt = buildSkillUserPrompt(instructions, context);
    const aiTools = convertToolsToAISDK(requestedTools);
    const result = await generateText({
      model,
      system: systemPrompt,
      prompt: userPrompt,
      tools: aiTools,
      maxSteps: 10
    });
    const toolCalls = result.steps.flatMap((step) => step.toolCalls || []).map((tc) => ({
      tool: tc.toolName,
      params: tc.args,
      result: {
        success: true,
        data: undefined
      }
    }));
    return {
      success: true,
      response: result.text,
      toolCalls
    };
  } catch (error) {
    return {
      success: false,
      response: "",
      error: error instanceof Error ? error.message : String(error)
    };
  }
}

