async function main2() {
  const { command, args } = parseArgs();
  switch (command) {
    case "interactive":
    case "i":
      await interactiveMode();
      break;
    case "chat":
    case "c":
      await chatCommand(args.join(" "));
      break;
    case "init":
      await initCommand();
      break;
    case "skills":
    case "s":
      await skillsCommand();
      break;
    case "help":
    case "--help":
    case "-h":
      showHelp();
      break;
    default:
      if (!command.startsWith("-")) {
        await chatCommand([command, ...args].join(" "));
      } else {
        console.log(source_default.red(`Unknown command: ${command}`));
        showHelp();
        process.exit(1);
      }
  }
}
main2().catch((error) => {
  console.error(source_default.red("Fatal error:"), error);
  process.exit(1);
});
